import axios from 'axios'

export class MSAuthAPI {
	public static getUser = (username: string) => {
		axios
			.get(`${ process.env.REACT_APP_BASE_URL }/user/get_empty/?username=${ username }`)
			.then(response => {
				console.log("puk")
				return response.data.pk
			})
			.catch(e => console.log(e.message))
	}
}
